module.exports = (startTime, endTime, interval) => {
    startTime = Number(startTime.split(':')[0]) * 60 + Number(startTime.split(':')[1]);
    endTime = Number(endTime.split(':')[0]) * 60 + Number(endTime.split(':')[1]);
    var slots = [];
    interval = interval * 60;
    var i = 0;
    for (let index = startTime; index <= endTime; index = index + interval) {
        const element = index;
        var hour = (element - element % 60) / 60;
        var min = element % 60;
        if (((hour + interval / 60) * 60) + min > endTime) {
            break;
        }
        if (min == 0) {
            min = '00';
        }
        slots[i] = hour + ':' + min + '-' + (hour + interval / 60) + ':' + min;
        i++;
    }
    return slots;
}